        <div class="versiones_fondos_content flex flex-col justify-between">
            <div class="versiones_fondos_txt body_azul txt pb-20">MARCA PRINCIPAL

                Siguiendo la paleta corporativa tendremos dos opciones de degradados y combinaciones con los colores planos
                corporativos, incluyendo versiones en blanco y negro.

                El uso del degradado se limita a las opciones que se ven en el manual: angular y radial, con el uso
                exclusivo de los 4 colores corporativos.

                Todas las versiones pueden usarse en positivo y negativo como se muestran a continuación. Se diseñaron
                diferentes composiciones por las necesidades que podría tener la marca.

                El alto contraste de los fondos favorece la visualización, diferenciación y definición en todos los
                planteamientos estéticos. </div>
